import json
import sys

# Parse the JSON string into a Python dictionary
json_data = json.loads(sys.argv[1])
# List to hold all the flattened data
flattened_data = []

# Loop through each item in 'data'
for item in json_data['data']:
    # Start with a flat dictionary containing 'guid' and 'exclusionType'
    flat_item = {
        "guid": item.get('guid', ''),
        "exclusionType": item.get('exclusionType', '')
    }

    # Flatten 'engineSettings' if it exists
    if 'engineSettings' in item:
        for setting, details in item['engineSettings'].items():
            flat_item[f"engineSettings_{setting}_applyToEngine"] = details.get('applyToEngine', False)
            # Special case for 'fileScan' to include 'applyToChildProcesses'
            if setting == 'fileScan':
                flat_item[f"engineSettings_{setting}_applyToChildProcesses"] = details.get('applyToChildProcesses', False)

    # Add other fields from the item, if needed
    for key in item:
        if key not in ('guid', 'exclusionType', 'engineSettings'):
            if isinstance(item[key], dict):
                # Flatten nested dictionaries
                for subkey, value in item[key].items():
                    flat_item[f"{key}_{subkey}"] = value
            else:
                flat_item[key] = item[key]

    # Add the flat_item to the list of flattened data
    flattened_data.append(flat_item)

# Now flattened_data contains the list with all data at the same level
# You can now use flattened_data as needed in your code, for example:
